</font><font face="Comic Sans MS"><font color="#000000"><strong><u>Maße :</u></strong> ca. 45 x 35 x 18 cm (Höhe x&nbsp;Breite x Tiefe) - ca. 30-35 Liter<br></font></font></p><p align="left"><font color="#000000">
</font><font face="Comic Sans MS"><font color="#000000"><strong><u>Material :</u></strong> super robuste&nbsp;Polyester Qualität (wasserabweisend und abwischbar)</font></font></p><p align="left"><font color="#000000">
