<div class="content_h">Passt dieses Ersatzteil in mein Fahrzeug ?</div>
<div class="content_text">
<p>Gerne beraten wir Sie, wenn es um die Frage geht, ob ein bestimmtes Bauteil auch in das vorgesehene Fahrzeug passt oder weitere Teile ben&ouml;tigt werden.<br /><span>Tel. <strong>02241-1681453</strong></span><strong>&nbsp;</strong></p>
</div>
<div class="content_h">Funktioniert dieses Ersatzteil ( nur bei Gebrauchtartikeln ) ?</div>
<div class="content_text">
<p>Die von uns angebotenen Gebrauchtteile werden in einer Meisterwerkstatt demontiert und mehrfach optisch, sowie auf Funktion, getestet. Sollte trotzdem ein Mangel &uuml;bersehen worden sein, besteht die M&ouml;glichkeit einer schnellen R&uuml;ckgabe.</p>
</div>
<div class="content_h">R&uuml;ckgabe</div>
<div class="content_text">
<p>Sollten Sie einen Defekt entdecken, senden Sie uns bitte einen kurze Information mit Rechnungsnummer und Schadensbeschreibung, gerne auch mit Bildern, zu. Bei R&uuml;ckgabe im Rahmen des Widerrufgesetzes finden Sie eine detaillierte Ausf&uuml;hrung in den <a href="http://www.kibisco.de/startseite/agb/" title="AGB - www.kibisco.de">AGB''s.</a></p>
</div>
<div class="content_h">Versand</div>
<div class="content_text">
<p>Der Versand erfolgt &uuml;ber DHL. Die Lieferzeit ab Zahlungseingang betr&auml;gt innerhalb Deutschlands ca. 2 Werktage. An (Samstagen) Sonn- und Feiertagen erfolgt keine Zustellung.</p>
</div>
<div class="content_h">Selbstabholung</div>
<div class="content_text">
<p>Bei Selbstabholung nehmen Sie bitte zun&auml;chst per Email oder Telefon Kontakt mit uns auf. Der von Ihnen bestellte Artikel wird dann zur Abholung bereit gelegt.</p>
</div>
<div class="content_h">Rechnung</div>
<div class="content_text">
<p>Sie erhalten immer eine Rechnung mit ausgewiesener Mehrwertsteuer. Auf der Rechnung finden Sie einen Gutscheincode, der Ihnen bei einer Folgebestellung in unserem ONLINESHOP einen Treuerabatt sichert</p>
