rdana"><b style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px">Klasse 1</b> <b style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px">entspricht der niedrigsten Wasserdichtigkeit und Klasse 5 der h&ouml;chsten Wasserdichtigkeit</b>.</span></b></span> <br style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: Verdana, Helvetica, sans-serif; PADDING-TOP: 0px" /><span style="FONT-FAMILY: Verdana; FONT-SIZE: 12px">Die Shop-Rating-System Klassen sind wie folgt definiert:<span style="FONT-FAMILY: Verdana">&nbsp;<br /><br />
<table style="BORDER-COLLAPSE: collapse" border="1">
<tbody>
<tr>
<td>&nbsp; 
<div style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: Verdana, Helvetica, sans-serif; PADDING-TOP: 0px" align="center"><span style="FONT-FAMILY: Verdana">
