<td><span style="FONT-SIZE: 11px"><strong>Klasse 2</strong> - Wasserdicht auch bei starkem Regen (Wasser von oben). <br />Es k&ouml;nnte Wasser eindringen, wenn das Produkt ins Wasser getaucht wird oder Wasser aus seitlichem Winkel auftrifft.</span></td></tr>
<tr>
<td>&nbsp; 
<div style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: Verdana, Helvetica, sans-serif; PADDING-TOP: 0px" align="center"><span style="FONT-FAMILY: Verdana">
<div style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px" align="center"><img style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: Verdana, Helvetica, sans-serif; PADDING-TOP: 0px" alt="" src="http://www.outdoor-packs.de/images/WPC_3.jpg" /></div></span></div></td>
<td><span style="FONT-SIZE: 11px"><strong>Klasse 3</strong> - Wasserdicht bei kurzem Eintauchen ins Wasser oder wenn das Produkt kurze Zeit auf dem Wasser schwimmt. <br />Es k&ouml;nnte Wasser eindringen, wenn das Produkt l&auml;ngere Zeit unter Wasser getaucht wird sowie wenn es hohem Wasserdruck ausgesetzt ist wie z. B. in einer Wassertiefe von mehr als 3 m.</span></td></tr>
<tr>
