<td><span style="FONT-SIZE: 11px"><strong>Klasse 4</strong> - Wasserdicht bis zu einer Tiefe von 3 m. Geeignet f&uuml;r Unterwasser-Sportarten wie Schwimmen und Schnorcheln.<br />Es k&ouml;nnte Wasser eindringen bei einem Untertauchen von mehr als 24 Std., extrem hohem Wasserdruck sowie Anwendungen, bei denen die Dichtungen besch&auml;digt werden k&ouml;nnen.</span></td></tr>
<tr>
