<div style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px" align="center"><img style="PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: Verdana, Helvetica, sans-serif; PADDING-TOP: 0px" alt="" src="http://www.outdoor-packs.de/images/WPC_5.jpg" /></div></span></div></td>
<td><span style="FONT-SIZE: 11px"><strong>Klasse 5</strong> - Wasserfest bis zu einer Tiefe von 6m. Geeignet f&uuml;r alle Unterwasser-Sportarten wie Tauchen, Schnorcheln, Wildwasser-Rafting etc. <br />Es k&ouml;nnte Wasser eindringen bei folgenden Anwendungen: Tiefen gr&ouml;&szlig;er als die vom Hersteller angegebene maximale Tiefe, Anwendungen oder physikalische Kraft, die eine wasserdichte Abdichtung gef&auml;hrden k&ouml;nnten.</span></td></tr></tbody></table></span></span><span style="TEXT-ALIGN: left; WIDOWS: 2; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; FONT: 11px Verdana, Helvetica, sans-serif; WHITE-SPACE: normal; ORPHANS: 2; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-decorations-in-effect: none; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" class="Apple-style-span"></span>
