expower.com/eBay_Auktionsdesign/bild_oben.jpg" width="511" height="10" /></td> </tr> <tr> <td align="center" style="border-left:solid 1px #DCDCDC; border-right:solid 1px #DCDCDC"><img src="http://images2.cortexpower.com/generated/product/1/1500_1500_75/5175_2000_01.jpg" width="450" /></td> </tr> <tr> <td><img src="http://www.cortexpower.com/eBay_Auktionsdesign/bild_unten.jpg" width="511" height="10" /></td> </tr> <tr> <td style="padding-top:15px" class="PageText"> Der Talon 33 ist der Hansdampf in allen Gassen seiner Serie und wird jedem Anspruch gerecht – vom Trekkingexperten, der Wert auf Tempo und geringes Gewicht legt, bis hin zum Hardcore-Alpinisten, der alles an einem Tag schaffen will. Der Toplader mit Deckeltasche sorgt dafür, dass alles an seinem Platz und griffbereit ist. Blinklichtbefestigung. Eisaxtbefestigung. Elastische Fronttasche. Elastische Seitentaschen. Hüftgurttaschen. Seilbefestigung. Trinkbeutelfach. Zugschlaufe. </td> </tr> </table> <!-- ### PRODUKTBILD + BESCHREIBUNG ENDE ### --> </td> <td valign="top"> <table style="width:182px" border="0" cellspacing="0" cellpadding="0"> <tr> <td><img src="http://www.cortexpower.com/eBay_Auktionsdesign/info_1.jpg" width="182" height="188" /></td> </tr> <tr> <td><img src="http://www.cortexpower.com/eBay_Auktionsdesign/info_2.jpg" width="182" height="35" /></td> </tr> <tr> <td><a href="mailto:mail@cortexpower.de"><img src="http://www.cortexpower.com/eBay_Auktionsdesign/info_3.jpg" width="182" height="33" border="0" /></a></td> </tr> <tr> <td><img src="http://www.cortexpower.com/eBay_Auktionsdesign/info_4.jpg" width="182" height="50" /></td> </tr> <tr> <td><a href="http://feedback.ebay.de/ws/eBayISAPI.dll?ViewFeedback2&amp;userid=cortexpower&amp;&amp;_trksid=p4340.l2560&amp;rt=nc&amp;iid=200803235149&amp;sspagename=VIP:feedback&amp;ftab=FeedbackAsSeller" target="_blank"><img src="http://www.cortexpower.com/eBay_Auktionsdesign/info_5.jpg" width="182" height="121" border="0" /></a></td> </tr> </table> </td> </tr