<p class="MsoNormal" style="color: black; margin: 5pt 0in; text-align: center;" align="center"><font face="Verdana" size="2"><b><span style="color: rgb(228, 108, 10);">Authentieke RDX Brand New Heavy Duty Floor Anchor System
</span></b></font></p>
<p class="MsoNormal" style="color: black; margin: 5pt 0in; text-align: center;" align="center"><font face="Verdana" size="2"><b><span style="color: rgb(228, 108, 10);">Zijn Bieden voor een afzonderlijk anker </span></b></font></p>
