<td><p align="justify"><span style="font-family: Verdana, sans-serif; font-size: 10pt;"><font color="#000000">Dit vloeranker van RDX zorgt dat je stootzak nóg minder beweegt. Je stootzak kan nu worden vastgezet zonder gaten in je vloer te hoeven boren. Een ander voordeel is dat dit anker draagbaar is. Het is gemaakt van echt Maya-leer en met nylonbanden en zware D-ringen. Die ringen zijn behandeld met roodoxide, zodat ze niet gaan roesten. Wordt ongevuld geleverd.  </font></span><font color="#000000"> <span style="font-family: Verdana, sans-serif; font-size: 10pt;"><font color="#000000">
<o:p></o:p>
