<o:p></o:p>
</strong></span>
<o:p></o:p>
<span style="font-family: Verdana, sans-serif; font-size: 10pt;">
<ul>
<li style="FONT-FAMILY: ''Verdana'',''sans-serif''; COLOR: black; FONT-SIZE: 10pt;margin-bottom: 6px;">Minimale beweging van je stootzak</li>
<li style="FONT-FAMILY: ''Verdana'',''sans-serif''; COLOR: black; FONT-SIZE: 10pt;margin-bottom: 6px;">Gemaakt van het beste Maya-leer</li>
<li style="FONT-FAMILY: ''Verdana'',''sans-serif''; COLOR: black; FONT-SIZE: 10pt;margin-bottom: 6px;">Sterke ritssluiting</li>
